import React from "react";

const Footer = () => {
  return (
    <footer>
      <p>@Copyright 2022 - Sidea Andreea</p>
      <p className="text">
        DATA Source: The USGS Earthquake Hazards Program of the U.S. Geological
        Survey(USGS),
        <p> part of the National Earthquake Hazards Reduction Program(NEHRP)</p>
        <p> led by the National Institute of Standards and Tehnology(NIST).</p>
      </p>
    </footer>
  );
};
export default Footer;
